function mergeArrays(arr1, arr2) {
  const set = new Set();

  // Iterate through both arrays and add unique objects to the set
  arr1.concat(arr2).forEach(obj => {
    const key = JSON.stringify([obj.stepId, obj.fieldId]);
    if (!set.has(key)) {
      set.add(key, obj);
    }
  });

  // Convert the set to an array and map the values to ensure message property is present
  return Array.from(set.values()).map(obj => {
    const firstObj = arr1.find(o => o.stepId === obj.stepId && o.fieldId === obj.fieldId);
    const secondObj = arr2.find(o => o.stepId === obj.stepId && o.fieldId === obj.fieldId);
    return Object.assign({}, obj, { message: firstObj?.message || secondObj?.message });
  });
}

